import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Diagnosis from './pages/Diagnosis';
import SyntheticReport from './pages/SyntheticReport';
import TreatmentPlan from './pages/Treatmentplan';
import Home from './pages/Home';

const App: React.FC = () => {
  return (
    <Router>
      <div className="min-h-screen flex flex-col bg-gradient-to-br from-blue-100 to-purple-100 font-sans">
        <div 
          className="absolute inset-0 bg-cover bg-center z-0" 
          style={{
            backgroundImage: "url('https://img.freepik.com/free-vector/abstract-medical-background-with-hexagons-pattern_1017-26877.jpg')",
            opacity: 0.1
          }}
        ></div>
        <div className="relative z-10">
          <nav className="bg-white bg-opacity-90 shadow-md backdrop-blur-md">
            <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
              <div className="flex justify-between h-16">
                <div className="flex items-center">
                  <Link to="/" className="flex items-center">
                    <img src="https://hebbkx1anhila5yf.public.blob.vercel-storage.com/ai-medical-logo-pngBBB8jTUVxWHYabdq8I6I8Hs0Xd1Hl.png" alt="MediAssist AI Logo" className="h-8 w-auto mr-2" />
                    <span className="text-xl font-semibold text-blue-600">MediAssist AI</span>
                  </Link>
                </div>
                <div className="flex items-center">
                  <Link to="/diagnosis" className="text-gray-700 hover:text-blue-600 px-3 py-2 rounded-md text-sm font-medium">Diagnosis</Link>
                  <Link to="/synthetic-report" className="text-gray-700 hover:text-blue-600 px-3 py-2 rounded-md text-sm font-medium">Synthetic Report</Link>
                  <Link to="/treatment-plan" className="text-gray-700 hover:text-blue-600 px-3 py-2 rounded-md text-sm font-medium">Treatment Plan</Link>
                </div>
              </div>
            </div>
          </nav>

          <main className="max-w-7xl mx-auto py-6 sm:px-6 lg:px-8">
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/diagnosis" element={<Diagnosis />} />
              <Route path="/synthetic-report" element={<SyntheticReport />} />
              <Route path="/treatment-plan" element={<TreatmentPlan />} />
            </Routes>
          </main>
        </div>
      </div>
    </Router>
  );
}

export default App;
